import React, { Component } from 'react';
import Header from '../header/header';
import LightVersion from '../Sidebar/Types/LightVersion';
import UserSidebarCopy from './Types/LightVersion/UserSidebarcopy'
import { grid } from 'react-icons-kit/feather/grid';
import { Icon } from 'react-icons-kit'
import './Sidebar.css'

const navLinks = [
    {
        text: 'Home',
        // path: '/',
        menuIcon: <Icon icon={grid}/>,
        iconActive: true,
        BadgeActive: true,
        badgeText: '+10'

    },
    {
        text: 'Contact',
        // path: '/contact',
        BadgeActive: true,
        badgeText: '+10',
        icon: 'ion-ios-megaphone'
    },
    {
        text: 'About',
        // path: '/about',
        BadgeActive: true,
        badgeText: '+10',
        icon: 'ion-ios-business'
    },
    {
        text: 'Blog',
        // path: '/blog',
        icon: 'ion-ios-bonfire'
    },
    {
        text: 'Portfolio',
        // path: '/portfolio',
        icon: 'ion-ios-briefcase'
    }
]
class Index extends Component {
    constructor(props) {
        super(props)
        this.state = {
            header: [
                { title: 'Sidebars' }
            ],
        }
    }
    render() {
        return (
            <div className="wrapper">
                <section className="container">
                    <div className="row">
                        <Header header={this.state.header[0].title} />  
                        <div className="row w-100">
                            <div className="col-md-12 mb-30">
                                <div className="h5 mb-20">Light Version</div>
                                <div className="row mb-50">
                                    <div className="col-md-4">
                                        <LightVersion 
                                            BrandActive={false}
                                            navLinks={ navLinks }
                                            // logo={ logo }
                                            background="#fff"
                                            hoverBackground="#ddd"
                                            linkColor="var(--primary)"
                                            badgeStyle={{background: 'yellow'}}
                                        />
                                    </div>
                                    <div className="col-md-4">
                                        <UserSidebarCopy />
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        );
    }
}

export default Index;
